        return (
            <div>
                <Navbar />
                <Grid container
            spacing={6}
            direction="column"
            alignItems="center"
            justify="center"
            style={{ maxHeight: '90vh',
            top: '50%'}}>
                <Grid item lg={3}>
                    <h1>Contact Me:</h1>
                    <Typography
          aria-owns={open ? 'mouse-over-popover' : undefined}
          aria-haspopup="true"
          onMouseEnter={this.handlePopoverOpen}
          onMouseLeave={this.handlePopoverClose}>Cell</Typography>
                     <Popover
                        id="mouse-over-popover"
                        className={classes.popover}
                        classes={{
                            paper: classes.paper,
                        }}
                        open={open}
                        anchorEl={anchorEl}
                        anchorOrigin={{
                        vertical: 'bottom',
                        horizontal: 'left',
                        }}
                        transformOrigin={{
                            vertical: 'top',
                            horizontal: 'left',
                             }}
                            onClose={this.handlePopoverClose}
                            disableRestoreFocus>
                            <Typography>843-271-3434</Typography>
                        </Popover>
                    {/* <Button onClick={this.toggle}>Email:</Button>
                        <Modal open={open} toggle={this.toggle}>
                            <ModalBody>walkerkeatley@yahoo.com</ModalBody>
                        </Modal> */}
                    {/* <h1>Email: walkerkeatley@yahoo.com</h1>
                    <h1>Social Media:</h1>
